import React, { useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import './Dashboard.css';
import MissionControl from './components/MissionControl';
import ObjectRecognition from './components/ObjectRecognition';
import Alerts from './components/Alerts';
import PayloadManagement from './components/PayloadManagement';
import TrainingSimulation from './components/TrainingSimulation';
import Settings from './components/Settings';

function Dashboard() {
  useEffect(() => {
    console.log("Dashboard component rendered");
  }, []);

  return (
    <div className="dashboard-container">
      <aside className="sidebar">
        <h2>AI Drone Rescue Command Center</h2>
        <ul>
          <li>
            <NavLink to="/" className={({ isActive }) => (isActive ? 'active' : '')}>
              Mission Control
            </NavLink>
          </li>
          <li>
            <NavLink to="/objectrecognition" className={({ isActive }) => (isActive ? 'active' : '')}>
              Object Recognition
            </NavLink>
          </li>
          <li>
            <NavLink to="/alerts" className={({ isActive }) => (isActive ? 'active' : '')}>
              Alerts
            </NavLink>
          </li>
          <li>
            <NavLink to="/payloadmanagement" className={({ isActive }) => (isActive ? 'active' : '')}>
              Payload Management
            </NavLink>
          </li>
          <li>
            <NavLink to="/trainingsimulation" className={({ isActive }) => (isActive ? 'active' : '')}>
              Training & Simulation
            </NavLink>
          </li>
          <li>
            <NavLink to="/settings" className={({ isActive }) => (isActive ? 'active' : '')}>
              Settings
            </NavLink>
          </li>
        </ul>
      </aside>
      <main className="main-content">
        <header className="header">
          <span>Welcome, Rescue Operator</span>
          <button className="logout-button">Logout</button>
        </header>
      </main>
    </div>
  );
}

export default Dashboard;
